Versi tanda tangan untuk versi Android:
V1 - opsi tanda tangan pertama, satu-satunya hingga Android 7.0; 
V2 - ditambahkan ke Android 7.0; 

Versi tanda tangan harus digunakan berdasarkan versi Android minimum yang diperlukan untuk aplikasi. Jika versi minimum adalah 30+ (Android 11+), tanda tangan V2 diperlukan.

Jika Anda tidak mencentang kotak centang "Simpan", skema yang dipilih hanya akan digunakan saat ini.

Versi tanda tangan untuk versi Android:
V1 - opsi tanda tangan pertama, satu-satunya hingga Android 7.0; 
V2 - ditambahkan ke Android 7.0; 
V3 - ditambahkan ke Android 9.0; 
V4 - ditambahkan ke Android 11; 

Versi tanda tangan harus digunakan berdasarkan versi Android minimum/target yang diperlukan untuk aplikasi. Jika versi target adalah 30+ (Android 11+), tanda tangan V2 diperlukan. V2 atau V3 harus digunakan bersama dengan tanda tangan V4. Versi V4 saat ini hampir tidak pernah digunakan.

Jika Anda tidak mencentang kotak centang "Simpan", maka skema yang dipilih hanya akan digunakan saat ini.
